		ble.s	Sonic_WallRecoil	; if yes, branch
		sub.w	d1,$10(a0)
		bset	#5,$22(a0)
		move.w	#0,$14(a0)
		rts
; ---------------------------------------------------------------------------

loc_FEF2:
